import React, {useState} from "react";

export const AddCategory = () => {

    const [state, setState] = useState("ingrese su busqueda")

    const handleInput = (e) => {
        setState(e.target.value)
    }

    return (
        <form>
            <h2>Add Category</h2>
            <input 
                type="text"  
                value={state}
                    onChange={handleInput} />
            <br />
            <span>el valor es: {state}</span>
        </form> 
    ) 
}
